Mongoose validate field execute in both save and update time<p>I'm using validate in mongoose schema for <code>unique name</code> now face issue while someone updates that record It won't allow the user to update because already have an entry in a database.</p>

<p>I've schema &amp; code like following.</p>

<p>Schema</p>

<pre><code>let mongoose = require('mongoose'),
    Schema = mongoose.Schema;

let pTSchema = mongoose.Schema({
    type: {
        type: String,
        required: true,
        validate: {
          validator: function(v, cb) {  
            v = v.toLowerCase();
            PT.aggregate([  // Query for validate type should be unique if already exist than through error.
                {
                    $addFields:{
                        lowerCase: { $toLower: "$type" }
                    }
                },
                {
                    $match:{
                        lowerCase: v
                    }
                }
            ], function(err,docs){
                console.log(docs, v);
                cb(docs.length == 0);
            });
          },
          message: 'p already exists!'
        }
    }
});

module.exports = PT = mongoose.model('pt', pTSchema);
</code></pre>

<p>Insert New Record.</p>

<pre><code>// Working as expected with validation
